export class Utils
{
  public static makeDate(input: string): Date
  {
    // return new Date(input); //TODO: this doesn't work right
    const date: Date = new Date();

    // let d = '12-07-2016';
    let d = input.split("-");
    let f = new Date(d[2], d[0] - 1, d[1]);
    return f;
  }
}
